var ZXGFILE0 = &quot;&quot;;
var zlbsxl = &quot;&quot;;

//数据加载完毕
function _thisOnpost_loaddata(sheet)
{
	_this.ShowToolBar(0);
	_this.SplitSheet(0,&quot;H&quot;,&quot;85%&quot;);
	ZXGFILE0 = _this.SaveTempZXGFile(0);

	 _sql.querytods(&quot;ZLBSXL&quot;,&quot;DJXH=&quot;+DJXH);
        zlbsxl = _this.XMLDS_GetString(0,&quot;zlbsxl_dm&quot;);

	loadBBRQ();	
	var bbrq1 = _this.GetCellText(1,2,2);
	var bbrq2 = _this.GetCellText(1,2,3);
	if (bbrq1 != &quot;&quot; && bbrq2 != &quot;&quot;) {
		loadData(bbrq1,bbrq2);
	}

}
//加载报表日期列表
function loadBBRQ()
{
	var xml = &quot;&quot;;

	if (zlbsxl==&apos;ZL1001001&apos;) {
          var zcfzbmc=&apos;SB_CWBB_QYKJZZYBQY_XJLLB&apos;;   //（适用执行一般企业会计制度的企业）   
          xml=_sql.query(&quot;BBRQ_XJLLB_YBQY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&TABMNE=&quot;+zcfzbmc);       
        }  
        else if (zlbsxl==&apos;ZL1001018&apos;) {
          var zcfzbmc=&apos;SB_CWBB_SYYH_XJLLB&apos;;  //企业会计准则（商业银行）财务报表报送与信息采集
          xml=_sql.query(&quot;BBRQ_XJLLB_JRY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&TABMNE=&quot;+zcfzbmc);   
        } 
        else if (zlbsxl==&apos;ZL1001003&apos;){
          //  var zcfzbmc=&apos;SB_CWBB_XQYKJZZ_LRB&apos;;  //（适用执行小企业会计制度的企业）
          xml=_sql.query(&quot;BBRQ_XJLLB_XQY&quot;,&quot;&DJXH=&quot;+DJXH);      
        }
        else if (zlbsxl==&apos;ZL1001019&apos;){
          var zcfzbmc=&apos;SB_CWBB_ZQGS_XJLLB&apos;;  //企业会计准则（证券公司）财务报表报送与信息采集利润表
          xml=_sql.query(&quot;BBRQ_XJLLB_JRY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&TABMNE=&quot;+zcfzbmc);    
        }
        else if (zlbsxl==&apos;ZL1001002&apos;)
        {   //利润表（适用执行企业会计制度的企业）
          xml=_sql.query(&quot;BBRQ_XJLLB_QYKJZZ&quot;,&quot;&DJXH=&quot;+DJXH);      
        }

	_this.SetXmlDS(1,2,0,5,3,xml);
	_this.SetFixedRow(1,2);
	_this.SetFixedCol(1,1);
	_this.SetAttribe(&quot;SHEET_1&quot;,_this.ATTR_SHEET_SELECTFLAG,_this.SELECTFLAG_SINGLEROW);

}

//加载查询数据
function loadData(bbrq1,bbrq2)
{	
	_this.LoadZXGFile(ZXGFILE0,-1,0);
//	 _sql.querytods(&quot;ZLBSXL&quot;,&quot;DJXH=&quot;+DJXH);
//        var zlbsxl = _this.XMLDS_GetString(0,&quot;zlbsxl_dm&quot;);
        var xml = &quot;&quot;;
        if (zlbsxl==&apos;ZL1001001&apos;) {
          var zcfzbmc=&apos;SB_CWBB_QYKJZZYBQY_XJLLB&apos;;   //（适用执行一般企业会计制度的企业）   
          xml=_sql.query(&quot;XJLLB_YBQY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&TABMNE=&quot;+zcfzbmc+&quot;&BBRQ1=&quot;+bbrq1+&quot;&BBRQ2=&quot;+bbrq2);       
        }  
        else if (zlbsxl==&apos;ZL1001018&apos;) {
          var zcfzbmc=&apos;SB_CWBB_SYYH_XJLLB&apos;;  //企业会计准则（商业银行）财务报表报送与信息采集
          xml=_sql.query(&quot;XJLLB_JRY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&TABMNE=&quot;+zcfzbmc+&quot;&BBRQ1=&quot;+bbrq1+&quot;&BBRQ2=&quot;+bbrq2);   
        } 
        else if (zlbsxl==&apos;ZL1001003&apos;){
          //  var zcfzbmc=&apos;SB_CWBB_XQYKJZZ_LRB&apos;;  //（适用执行小企业会计制度的企业）
          xml=_sql.query(&quot;XJLLB_XQY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&BBRQ1=&quot;+bbrq1+&quot;&BBRQ2=&quot;+bbrq2);      
        }
        else if (zlbsxl==&apos;ZL1001019&apos;){
          var zcfzbmc=&apos;SB_CWBB_ZQGS_XJLLB&apos;;  //企业会计准则（证券公司）财务报表报送与信息采集利润表
          xml=_sql.query(&quot;XJLLB_JRY&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&TABMNE=&quot;+zcfzbmc+&quot;&BBRQ1=&quot;+bbrq1+&quot;&BBRQ2=&quot;+bbrq2);    
        }
        else if (zlbsxl==&apos;ZL1001002&apos;)
        {   //利润表（适用执行企业会计制度的企业）
       //  var zcfzbmc=&apos;SB_CWBB_QYKJZZ_LRB&apos;; 
          xml=_sql.query(&quot;XJLLB_QYKJZZ&quot;,&quot;&DJXH=&quot;+DJXH+&quot;&BBRQ1=&quot;+bbrq1+&quot;&BBRQ2=&quot;+bbrq2);      
        }

        _this.SetXmlDS(0,3,1,_this.GetRowCount(0)-1,_this.GetColCount(0)-1,xml); 
	_this.XMLDS_Parse(xml); 


    	_this.AutoFixScreenWidth();
}

//鼠标双击
function _thisOnMouseDClick(sheet,row,col)
{
	if (sheet == 1 && row &gt;= 2) {
		var dat1 = _this.GetCellText(1,row,2);
		var dat2 = _this.GetCellText(1,row,3);
		for (var r=2;r&lt;_this.GetRowCount(1);r++) {
			_this.SetCellText(1,r,0,&quot;&quot;);
		}
		_this.SetCellText(1,row,0,&quot;*&quot;);
		if (dat1 != &quot;&quot; && dat2 != &quot;&quot;) {
			loadData(dat1,dat2);
		}
	}
}

